import {BrowserRouter, Switch, Route} from 'react-router-dom'
import Navbar from './componentsJs/Navbar';


function App() {
  return (
    <BrowserRouter>
    <Switch>
      <Route path = './' exact component={Navbar}/>

    </Switch>
    </BrowserRouter>
  );
}

export default App;
